  "name": "_GW+job Multilanguage",
  "value": "-- GW + Job\ndeclare \n @country varchar(2) = 'ca',\n @default_headline nvarchar(30) = N'Jobs in Canada',\n @default_path1 nvarchar(15) = N'Jobs',\n @default_path2 nvarchar(15) = N'Canada',\n -- Default Parameters\n @id_language tinyint = 0,\n @code_language varchar(2) = 'en',\n @max_keyword_words tinyint = 10,\n @query_limit int = 3,\n @desc_type nvarchar(50) = 'all',\n @gw_type  nvarchar(50) = 'gw+jobs';\n\n with query(id, cnt, ss) as (\n\tselect id, LEN(ss)cnt, ss from legent.seo_query \n\twhere country = @country\n\tand id_language = @id_language\n ),\n gw(word, cnt) as (\n  select word, LEN(word)cnt from legent.library_general_words\n  where country = @country \n  and isnull(type, @gw_type) = @gw_type\n  and lang = @code_language\n ),\n matrix(id_query) as (\n\tselect id_query from legent.matrices \n\twhere country = @country \n\tand count >= @query_limit\n\tand id_region = 0\n ),\n dscr(id, text, ad_label) as (\n\tselect id, text, ad_label \n\tfrom legent.library_descriptions \n\twhere country = @country \n\tand type = @desc_type\n\tand lang = @code_language\n )\n select \n\n\tdbo.UpFirstSymbol(query.ss)\t\tas job,\n\tdbo.UpFirstSymbol(gw.word)\t\tas gw,\n\tdscr.text\t\t\t\t\t\tas descriptions,\n\t\n\tdbo.UpFirstSymbol( case\n\t\twhen gw.cnt + 1 + query.cnt < 30 \n\t\t\tthen gw.word + ' ' + query.ss\n\t\twhen query.cnt < 30 then query.ss\n\t\twhen gw.cnt < 30 then gw.word\n\t\telse @default_headline end\n\t)\t\t\t\t\t\t\t\tas headline,\n\n\tdbo.UpFirstSymbol( case\n\t\twhen gw.cnt < 15 \n\t\tthen gw.word else @default_path1 end\n\t)\t\t\t\t\t\t\t\tas path1,\n\t\n\tdbo.UpFirstSymbol( case\n\t\twhen query.cnt < 15 \n\t\tthen query.ss else @default_path2 end\n\t)\t\t\t\t\t\t\t\tas path2,\n\t\n\t'+' + REPLACE(gw.word,' ',' +')\t+ \n\t' +' + REPLACE(query.ss,' ',' +')\n\t                                as keywordWithPluses,\n\tdscr.ad_label\t\t\t\t\tas label,\n\tREPLACE(query.ss,' ','-') url \n\n--insert into--\n from matrix \n inner join query on query.id = matrix.id_query\n inner join gw on 1=1\n inner join dscr on 1=1\n where query.cnt + gw.cnt + 1 <= 60\n and len(query.cnt + gw.cnt) \n - len(REPLACE(query.cnt + gw.cnt,' ','')) < @max_keyword_words",
  "created_at": "2019-09-26 12:50:12.677",
