  "value": "-- UK_Desktop_cpc1 [gw+location]\ndrop temporary table if exists  t_matrices;\ncreate temporary table t_matrices (primary key (id_region)) select id_region from matrices limit 0;\ninsert into t_matrices select id_region from matrices where id_query = 0 and count >= 3 and country = 'co';\n\n-- insert --\nselect\n  UpFirstSymbol(location.name, ' ') as location,\n  UpFirstSymbol(gw.word, ' ') as gw,\n  descriptions.text as descriptions,\n  UpFirstSymbol(\n      case\n      WHEN CHAR_LENGTH(CONCAT(gw.word,' ',location.name)) < 30\n        then CONCAT(gw.word,' ',location.name)\n      when CHAR_LENGTH(location.name) < 30\n        then location.name\n      when CHAR_LENGTH(gw.word) < 30\n        then gw.word\n      else 'Trabajo en Colombia'\n      end\n      ,' ') as headline,\n      \n      UpFirstSymbol( \n        case WHEN CHAR_LENGTH(gw.word) < 15 then gw.word else 'Trabajo' end,' '\n        ) as path1,\n        \n      UpFirstSymbol( \n        case WHEN CHAR_LENGTH(location.name) < 15 then location.name else 'Colombia' end ,' '\n        ) as path2,\n\n  CONCAT('+',REPLACE(gw.word,' ',' +')) as gwWithPluses,\n  CONCAT('+',REPLACE(location.name,' ',' +')) as locationWithPluses,\n  REPLACE(location.display_name,' ','-') as display_name,\n  \n  descriptions.ad_label label\nfrom library_general_words gw\n  join (select min(id)id, name, display_name from co_info_region group by name, display_name order by id) location\n  join library_descriptions descriptions\n  join t_matrices matrices on matrices.id_region = location.id\nwhere gw.country = 'co'\n  and descriptions.country = 'co'\n  and (gw.type is null\n      or gw.type = 'gw+location')\n  and (CHAR_LENGTH(CONCAT(gw.word,' ',location.name)) \n\t\t- CHAR_LENGTH(REPLACE(CONCAT(gw.word,' ',location.name), ' ', '')) + 1) <= 10\n  and CHAR_LENGTH(CONCAT(gw.word,' ',location.name)) <= 60",
  "created_at": "2018-10-09 16:56:22.000",
