  "value": "-- BR_Desktop_cpc1 [job+location]\ndrop temporary table if exists  t_matrices;\n\ncreate temporary table t_matrices (primary key (id_region, id_query)) \n    select id_region, id_query from matrices limit 0;\n    \ninsert into t_matrices select id_region, id_query from matrices\n    where count >= 3 and country = 'ro';\n\n-- insert --\nselect\n  UpFirstSymbol(info_region.name, ' ') as location,\n  \n  UpFirstSymbol(seo_query.ss, ' ') as job,\n  \n  library_descriptions.text as descriptions,\n  \n  UpFirstSymbol(\n      case\n      WHEN CHAR_LENGTH(CONCAT(seo_query.ss,' ',info_region.name)) < 30\n        then CONCAT(seo_query.ss,' ',info_region.name)\n      when CHAR_LENGTH(info_region.name) < 30\n        then info_region.name\n      when CHAR_LENGTH(seo_query.ss) < 30\n        then seo_query.ss\n      else 'Locuri de munc\u0103 \u00een Rom\u00e2nia'\n      end\n      ,' ') as headline,\n      \n  UpFirstSymbol( \n        case WHEN CHAR_LENGTH(seo_query.ss) < 15 then seo_query.ss else 'Locuri de munc\u0103' end,' '\n        ) as path1,\n        \n  UpFirstSymbol( \n        case WHEN CHAR_LENGTH(info_region.name) < 15 then info_region.name else 'Rom\u00e2nia' end ,' '\n        ) as path2,\n        \n  CONCAT('+',REPLACE(seo_query.ss,' ',' +')) as jobWithPluses,\n  \n  CONCAT('+',REPLACE(info_region.name,' ',' +')) as locationWithPluses,\n  \n  library_descriptions.ad_label label,\n  \n  CONCAT(REPLACE(seo_query.ss,' ','-') ) urlJob,\n  CONCAT(REPLACE(info_region.name,' ','-') ) urlLocation \n  \nfrom ro_seo_query seo_query\n  join (select min(id)id, name from ro_info_region group by name) info_region\n  join library_descriptions\n  join t_matrices matrices  on matrices.id_region = info_region.id and matrices.id_query = seo_query.id\nwhere library_descriptions.country = 'ro'\n  and library_descriptions.type = 'all'\n  and (CHAR_LENGTH(CONCAT(seo_query.ss,' ',info_region.name)) \n\t\t- CHAR_LENGTH(REPLACE(CONCAT(seo_query.ss,' ',info_region.name), ' ', '')) + 1) <= 10\n  and CHAR_LENGTH(CONCAT(seo_query.ss,' ',info_region.name)) <= 60",
