  "name": "Crafter_UY_Desktop_cpc1 [gw+job]",
  "value": "-- UY_Desktop_cpc1 [gw+job]\r\ndrop temporary table if exists  t_matrices;\r\ncreate temporary table t_matrices (primary key (id_query)) select id_query from matrices limit 0;\r\ninsert into t_matrices select id_query from matrices where id_region = 0 and count >= 3 and country = 'uy';\r\n\r\n-- insert --\r\nselect\r\n  UpFirstSymbol(job.ss, ' ') as job,\r\n  UpFirstSymbol(gw.word, ' ') as gw,\r\n  descriptions.text as descriptions,\r\n  UpFirstSymbol(\r\n      case\r\n      WHEN CHAR_LENGTH(CONCAT(gw.word,' ',job.ss)) < 30\r\n        then CONCAT(gw.word,' ',job.ss)\r\n      when CHAR_LENGTH(job.ss) < 30\r\n        then job.ss\r\n      when CHAR_LENGTH(gw.word) < 30\r\n        then gw.word\r\n      else 'Trabajo Uruguay'\r\n      end\r\n      ,' ') as headline,\r\nUpFirstSymbol( \r\n      case\r\n      WHEN CHAR_LENGTH(gw.word) < 15\r\n        then gw.word\r\n      else 'Trabajo'\r\n      end\r\n      \r\n,' ') as path1,\r\n      UpFirstSymbol( \r\n      case\r\n      WHEN CHAR_LENGTH(job.ss) < 15\r\n        then job.ss\r\n      else 'Uruguay'\r\n      end\r\n      \r\n,' ') as path2,\r\n  CONCAT('+',REPLACE(gw.word,' ',' +')) as gwWithPluses,\r\n  CONCAT('+',REPLACE(job.ss,' ',' +')) as jobWithPluses,\r\n  descriptions.ad_label label,\r\n  \r\n  REPLACE(job.ss,' ','-') url \r\n  \r\nfrom library_general_words gw\r\n  join uy_seo_query job\r\n  join library_descriptions descriptions\r\n  join t_matrices matrices on matrices.id_query = job.id\r\nwhere gw.country = 'uy'\r\n  and descriptions.country = 'uy'\r\n  and descriptions.type = 'all'\r\n  and (gw.type is null\r\n      or gw.type = 'gw+jobs')\r\n  and (CHAR_LENGTH(CONCAT(gw.word,' ',job.ss)) \r\n\t\t- CHAR_LENGTH(REPLACE(CONCAT(gw.word,' ',job.ss), ' ', '')) + 1) <= 10\r\n  and CHAR_LENGTH(CONCAT(gw.word,' ',job.ss)) <= 60",
