  "value": "-- GW + Location\r\ndeclare \r\n @country varchar(2) = 'ua',\r\n @default_headline nvarchar(30) = N'\u0420\u043e\u0431\u043e\u0442\u0430 \u0432 \u0423\u043a\u0440\u0430\u0457\u043d\u0456',\r\n @default_path1 nvarchar(15) = N'\u0420\u043e\u0431\u043e\u0442\u0430',\r\n @default_path2 nvarchar(15) = N'\u0423\u043a\u0440\u0430\u0457\u043d\u0430',\r\n -- Default Parameters\r\n @id_language tinyint = 1,\r\n @max_keyword_words tinyint = 10,\r\n @query_limit int = 3,\r\n @desc_type nvarchar(50) = 'all',\r\n @gw_type  nvarchar(50) = 'gw+location';\r\n\r\n with region(id, cnt, name) as (\r\n  select id, LEN(name)cnt, name from legent.info_region \r\n  where country = @country\r\n  and id_language = @id_language\r\n ),\r\n gw(word, cnt) as (\r\n  select word, LEN(word)cnt from legent.library_general_words\r\n  where country = @country \r\n  and isnull(type, @gw_type) = @gw_type\r\n ),\r\n matrix(id_region) as (\r\n\tselect id_region from legent.matrices \r\n\twhere country = @country \r\n\tand count >= @query_limit\r\n\tand id_query = 0\r\n ),\r\n dscr(id, text, ad_label) as (\r\n\tselect id, text, ad_label \r\n\tfrom legent.library_descriptions \r\n\twhere country = @country and type = @desc_type\r\n )\r\n select \r\n\r\n\tdbo.UpFirstSymbol(region.name)\tas location,\r\n\tdbo.UpFirstSymbol(gw.word)\t\tas gw,\r\n\tdscr.text\t\t\t\t\t\tas descriptions,\r\n\t\r\n\tdbo.UpFirstSymbol( case\r\n\t\twhen gw.cnt + 1 + region.cnt < 30 \r\n\t\t\tthen gw.word + ' ' + region.name\r\n\t\twhen region.cnt < 30 then region.name\r\n\t\twhen gw.cnt < 30 then gw.word\r\n\t\telse @default_headline end\r\n\t)\t\t\t\t\t\t\t\tas headline,\r\n\r\n\tdbo.UpFirstSymbol( case\r\n\t\twhen gw.cnt < 15 \r\n\t\tthen gw.word else @default_path1 end\r\n\t)\t\t\t\t\t\t\t\tas path1,\r\n\t\r\n\tdbo.UpFirstSymbol( case\r\n\t\twhen region.cnt < 15 \r\n\t\tthen region.name else @default_path2 end\r\n\t)\t\t\t\t\t\t\t\tas path2,\r\n\t\r\n\t'+' + REPLACE(gw.word,' ',' +')\tas jobWithPluses,\r\n\t'+' + REPLACE(region.name,' ',' +')\tas locationWithPluses,\r\n\tREPLACE(region.name,' ','-')\tas display_name\r\n\r\n--insert into--\r\n from matrix \r\n inner join region on region.id = matrix.id_region\r\n inner join gw on 1=1\r\n inner join dscr on 1=1\r\n where region.cnt + gw.cnt + 1 <= 60\r\n and len(region.cnt + gw.cnt) \r\n - len(REPLACE(region.cnt + gw.cnt,' ','')) < @max_keyword_words",
  "created_at": "2019-08-30 00:39:29.070",
  "updated_at": "2019-08-30 00:59:17.703"
