  "id": 316,
  "name": "ZA_Job+Location",
  "value": "-- Job + Location\r\ndeclare \r\n @country varchar(2) = 'za',\r\n @default_headline nvarchar(30) = N'Jobs South Africa',\r\n @default_path1 nvarchar(15) = N'Jobs',\r\n @default_path2 nvarchar(15) = N'South Africa',\r\n -- Default Parameters\r\n @id_language tinyint = 0,\r\n @max_keyword_words tinyint = 10,\r\n @query_limit int = 3,\r\n @desc_type nvarchar(50) = 'all',\r\n @gw_type  nvarchar(50) = 'job+location';\r\n\r\n with region(id, cnt, name) as (\r\n  select id, LEN(name)cnt, name from legent.info_region \r\n  where country = @country\r\n  and id_language = @id_language\r\n ),\r\n query(id, cnt, ss) as (\r\n\tselect id, LEN(ss)cnt, ss from legent.seo_query \r\n\twhere country = @country\r\n\tand id_language = @id_language\r\n ),\r\n matrix(id_region,id_query) as (\r\n\tselect id_region,id_query from legent.matrices \r\n\twhere country = @country \r\n\tand count >= @query_limit\r\n ),\r\n dscr(id, text, ad_label) as (\r\n\tselect id, text, ad_label \r\n\tfrom legent.library_descriptions \r\n\twhere country = @country and type = @desc_type\r\n )\r\n select \r\n\tdbo.UpFirstSymbol(region.name)\tas location,\r\n\tdbo.UpFirstSymbol(query.ss)\t\tas job,\r\n\tdscr.text\t\t\t\t\t\tas descriptions,\r\n\tdbo.UpFirstSymbol( case\r\n\t\twhen query.cnt + 1 + region.cnt < 30 \r\n\t\t\tthen query.ss + ' ' + region.name\r\n\t\twhen region.cnt < 30 then region.name\r\n\t\twhen query.cnt < 30 then query.ss\r\n\t\telse @default_headline end\r\n\t)\t\t\t\t\t\t\t\tas headline,\r\n\tdbo.UpFirstSymbol( case\r\n\t\twhen query.cnt < 15 \r\n\t\tthen query.ss else @default_path1 end\r\n\t)\t\t\t\t\t\t\t\tas path1,\r\n\r\n\tdbo.UpFirstSymbol( case\r\n\t\twhen region.cnt < 15 \r\n\t\tthen region.name else @default_path2 end\r\n\t)\t\t\t\t\t\t\t\tas path2,\r\n\r\n\t'+' + REPLACE(query.ss,' ',' +') +\r\n\t' +' + REPLACE(region.name,' ',' +')\t\r\n\t                                as keywordWithPluses,\r\n\tdscr.ad_label\t\t\t\t\tas label,\r\n\tREPLACE(query.ss,' ','-')\t\tas urlJob,\r\n\tREPLACE(region.name,' ','-')\tas urlLocation\r\n--insert into--\r\n from matrix \r\n inner join region on region.id = matrix.id_region\r\n inner join query on query.id = matrix.id_query\r\n inner join dscr on 1=1\r\n where region.cnt + query.cnt + 1 <= 60\r\n  and len(region.cnt + query.cnt) \r\n - len(REPLACE(region.cnt + query.cnt,' ','')) < @max_keyword_words",
